def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        current_line += char
        if wait_for_nl:
            if char == '\n':
                if current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]

                lines.append(current_line)
                current_line = ""
                current_column = 0
                wait_for_nl = False
        elif char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 4
        elif char == '\n':
            # Adjust current_column based on the actual indentation level
            current_column = 0
            for c in current_line:
                if c == ' ':
                    current_column += 1
                elif c == '\t':
                    current_column += 4
                else:
                    break
        else:
            # indent is finished
            wait_for_nl = True
    return ''.join(lines), current_line
